import { createStore } from 'vuex';

export const store = createStore({
    state: {
        credentials: {
            email: "",
            host: "",
            database: "",
            user: "",
            password: ""
        }
    },
    mutations: {
        setCredentials(state, creds) {
            state.credentials = creds;
        }
    }
});
